In small cats - like domestic cats, bobcats, lynxes, cheetahs and cougars - this bone is completely ossified and rigid. When the larynx vibrates, it can make the hyoid bone resonate, generating a low-frequency bone resonate, generating a low-frequency rumble that we call purring. The noise persists even when the cat breathes in and out.
In big cat species, however, the hyoid bone is only partly ossified, and this fundamentally changes what noises the animal can make.
Lions, tigers, leopards and jaguars have more flexible hyoid bones that are partly attached to the skull with an elastic ligament, and while these can produce deep and terrifying roars, they cannot produce purrs. So, what you‚Äôre hearing here is not a purr - it just sounds like one. üêà";}i:147;a:1:{s:14:"comments_count";i:2;}i:148;a:1:{s:11:"likes_count";i:2;}i:149;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEuuDS4HPGa";}i:150;a:1:{s:5:"image";s:238:"https://scontent-sin6-2.cdninstagram.com/v/t51.2885-15/e35/118775237_181255916850092_3009304801053266202_n.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=108&_nc_ohc=8EqXEKSEztIAX-pfkPi&oh=d15b0ddb4920b1fffcf2dd9b471d9449&oe=5F552D67";}i:151;a:1:{s:4:"type";s:5:"video";}i:152;a:1:{s:8:"owner_id";i:35060201251;}i:153;a:1:{s:14:"owner_username";s:0:"";}i:154;a:1:{s:14:"owner_fullname";s:0:"";}i:155;a:1:{s:9:"owner_pic";s:0:"";}i:156;a:1:{s:2:"id";s:19:"2391054154069773729";}i:157;a:1:{s:10:"short_code";s:11:"CEuuxW0DQ2h";}i:158;a:1:{s:12:"created_time";i:1599255888;}i:159;a:1:{s:7:"caption";s:32:"#fallhair #leopard #lupuswarrior";}i:160;a:1:{s:14:"comments_count";i:0;}i:161;a:1:{s:11:"likes_count";i:0;}i:162;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEuuxW0DQ2h";}i:163;a:1:{s:5:"image";s:238:"https://scontent-sin6-1.cdninstagram.com/v/t51.2885-15/e35/118788319_175941437377212_3628817351457700480_n.jpg?_nc_ht=scontent-sin6-1.cdninstagram.com&_nc_cat=100&_nc_ohc=eAELibqxXd0AX_1zH8i&oh=b6a4e0d9eaca946cd5ee4bb101cf001b&oe=5F7CAB7A";}i:164;a:1:{s:4:"type";s:5:"image";}i:165;a:1:{s:8:"owner_id";i:22182618012;}i:166;a:1:{s:14:"owner_username";s:0:"";}i:167;a:1:{s:14:"owner_fullname";s:0:"";}i:168;a:1:{s:9:"owner_pic";s:0:"";}i:169;a:1:{s:2:"id";s:19:"2391053996985752789";}i:170;a:1:{s:10:"short_code";s:11:"CEuuvEhHRzV";}i:171;a:1:{s:12:"created_time";i:1599255869;}i:172;a:1:{s:7:"caption";s:309:"A new Hat can change your life‚ù§Ô∏è
